import React from "react";
import { useQuery, gql } from "@apollo/client";

const GET_ALL_USERS = gql`
  query GetAllUsers {
    users {
      id
      name
      username
    }
  }
`;

function DisplayData() {
  const { data } = useQuery(GET_ALL_USERS);
  return <div>List of Users</div>;
}

export default DisplayData;
